#include <fuzzer/FuzzedDataProvider.h>
#include <chrono>
#ifndef iostream
#include <iostream>
#endif
#include <vector>
#include <cstdint>

// Assuming the Object class is defined somewhere in the Gfx namespace
class Object {
    // Object class definition
};

namespace Gfx {
    void opSetExtGState(Object *obj, int state) {
        // Function implementation
    }
}

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
auto start_target = std::chrono::high_resolution_clock::now();
    FuzzedDataProvider stream(data, size);

    // Create an Object instance
    Object obj; // Assuming a default constructor is available

    // Consume an integer value for the state
    int state = stream.ConsumeIntegral<int>();

    // Call the function under test
	auto start_func = std::chrono::high_resolution_clock::now();
    Gfx::opSetExtGState(&obj, state);
	auto end_func = std::chrono::high_resolution_clock::now();
auto end_target = std::chrono::high_resolution_clock::now();
std::cout<<"Target runtime : "<<std::chrono::duration_cast<std::chrono::nanoseconds>(end_target-start_target).count()<<", Function runtime : "<<std::chrono::duration_cast<std::chrono::nanoseconds>(end_func - start_func).count()<<std::endl;

    return 0;
}

#include <fuzzer/FuzzedDataProvider.h>
#include <chrono>
#ifndef iostream
#include <iostream>
#endif
#include <vector>

// Assuming Object is a predefined class in the Gfx namespace
namespace Gfx {
    class Object {
        // Object class definition
    };

    void opSetExtGState(Object *obj, int state) {
        // Function implementation
    }
}

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
auto start_target = std::chrono::high_resolution_clock::now();
    // Create a FuzzedDataProvider instance
    FuzzedDataProvider stream(data, size);

    // Initialize the Object pointer
    Gfx::Object obj; // Create an instance of Object
    Gfx::Object *obj_ptr = &obj; // Get a non-null pointer to the instance

    // Consume an integer from the fuzz input
    int state = stream.ConsumeIntegral<int>();

    // Call the function under test
	auto start_func = std::chrono::high_resolution_clock::now();
    Gfx::opSetExtGState(obj_ptr, state);
	auto end_func = std::chrono::high_resolution_clock::now();
auto end_target = std::chrono::high_resolution_clock::now();
std::cout<<"Target runtime : "<<std::chrono::duration_cast<std::chrono::nanoseconds>(end_target-start_target).count()<<", Function runtime : "<<std::chrono::duration_cast<std::chrono::nanoseconds>(end_func - start_func).count()<<std::endl;

    return 0;
}
